import React, { Component } from "react";
import "./Navi.css";

export default class Navi extends Component {
  render() {
    return (
      <div>
        <div class="navbar">
          <a class="logo" href="#">
            {" "}
            Trendyol
          </a>
          <ul class="nav">
            <li>
              <a href="#home">Home</a>
            </li>
            <li>
              <a href="#about">About</a>
            </li>
            <li>
              <a href="#portfolio">Portfolio</a>
            </li>
            <li>
              <a href="#services">Service</a>
            </li>
            <li>
              <a href="#contact">Contact</a>
            </li>
          </ul>
        </div>
      </div>
    );
  }
}
